import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import PlayerPicksPage from './components/PlayerPicksPage';
import PrintableGamesPage from './components/PrintableGamesPage';
import AdminUploadPage from './components/AdminUploadPage';
import AdminWinnersPage from './components/AdminWinnersPage';
import ScoredPicksPage from './components/ScoredPicksPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/picks/week/:week" element={<PlayerPicksPage />} />
        <Route path="/print/week/:week" element={<PrintableGamesPage />} />
        <Route path="/admin/upload" element={<AdminUploadPage />} />
        <Route path="/admin/winners" element={<AdminWinnersPage />} />
        <Route path="/scores/week/:week" element={<ScoredPicksPage />} />
      </Routes>
    </Router>
  );
}

export default App;
